pragma solidity ^0.4.24;

contract Ownable {
    address public owner;

    event OwnershipTransferred(address indexed previousOwner, address indexed newOwner);

    constructor() public {
        owner = msg.sender;
    }

    modifier onlyOwner() {
        require(msg.sender == owner);
        _;
    }

    function transferOwnership(address newOwner) public onlyOwner {
        require(newOwner != address(0));
        emit OwnershipTransferred(owner, newOwner);
        owner = newOwner;
    }
}

contract PassportStorage is Ownable{
    event UserRegistered(address userAddress);

    struct Passport{
        bool exists;
        string firstName;
        string lastName;
        string gender;
        string description;
        uint registered;
    }

    mapping (address => Passport) internal register;
    address[] internal addresses;


    constructor() public {

    }

    function exists(address userAddress) public view returns (bool) {
        Passport memory passport = register[userAddress];
        return passport.exists;
    }

    function getList() public view returns (address[] list) {
        list = addresses;
    }

    function registerPassport(string firstName, string lastName, string gender, string description) public payable{
        //require(!exists(msg.sender));

        Passport memory data = Passport({
            exists: true,
            firstName: firstName,
            lastName: lastName,
            gender: gender,
            description: description,
            registered: now
        });

        register[msg.sender] = data;

        addresses.push(msg.sender);

        emit UserRegistered(msg.sender);
    }

    function getUserPassport(address userAddress) public view returns (
            string firstName,
            string lastName,
            string gender,
            string description,
            uint registered
    ){
        require(exists(userAddress));
        Passport memory data = register[userAddress];

        firstName = data.firstName;
        lastName = data.lastName;
        gender = data.gender;
        description = data.description;
        registered = data.registered;
    }
}
